Having regard to the Treaty establishing the European Economic Community,
Having regard to Council Regulation (EEC) No 3896/89 of 18 December 1989 applying generalized tariff preferences for 1990 in respect of certain industrial products originating in developing countries (1), as amended by Regulation (EEC) No 3211/90 (2), and in particular Article 9 thereof,
Whereas, pursuant to Articles 1 and 6 of Regulation (EEC) No 3896/89, suspension of customs duties is accorded to each of the countries or territories listed in Annex III other than those listed in column 4 of Annex I, within the framework of the preferential tariff ceilings fixed in column 6 of Annex I;
Whereas Article 7 of that Regulation provides that the levying of customs duties on imports of the products in question originating in each of the countries and territories concerned may at any time be re-established as soon as the individual ceilings in question are reached at Community level;
Whereas, in the case of the products falling within CN code 3503 00 10 originating in Pakistan, the individual ceiling amounts to ECU 700 000; whereas that ceiling was reached on 20 June 1990, by charges of imports into the Community of the products in question originating in Pakistan; whereas, it is appropriate to re-establish the levying of customs duties for the products in question with regard to Pakistan,
